import React from "react";
import { signOut } from "../../../state/ducks/user/actions";

const Header = () => {
  return (
    <div className="header-container">
      <h1>Header</h1>
      <button
        onClick={() => {
          signOut();
        }}
      >
        LogOut
      </button>
    </div>
  );
};

export default Header;
